import React,{useState} from 'react'
import moment from 'moment'

function Time(){
    const [nowTime,setTime] = useState(Date.now())

    const timeChange = ()=>{
        setTime(moment(Date.now()).format())
    }

    return(
        <div>
            <div>当前时间为：{nowTime}</div>
            <div><button onClick={timeChange}>改变时间格式</button></div>
        </div>
    )
}

export default Time
